DROP VIEW IF EXISTS `vw_appointment`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `vw_appointment` AS select `app`.`Id` AS `Id`,`app`.`TokenNo` AS `TokenNo`,`app`.`ClientId` AS `ClientId`,`app`.`PatientId` AS `PatientId`,`patient`.`PatientName` AS `PatientName`,`app`.`DoctorId` AS `DoctorId`,`doc`.`DoctorName` AS `Doctor`,`app`.`GenderId` AS `GenderId`,`gender`.`Name` AS `Gender`,`app`.`StatusId` AS `StatusId`,`status`.`Name` AS `Status`,`app`.`Date` AS `Date`,`app`.`Time` AS `Time`,`app`.`Age` AS `Age`,`patient`.`DateOfBirth` AS `DOB`,`app`.`CreatedOn` AS `CreatedOn`,`app`.`CreatedById` AS `CreatedById`,`app`.`ModifiedOn` AS `ModifiedOn`,`app`.`ModifiedById` AS `ModifiedById`,`app`.`IsActive` AS `IsActive` from ((((`appointment` `app` left join `patient` on(((`patient`.`Id` = `app`.`PatientId`) and (`patient`.`ClientId` = `app`.`ClientId`)))) left join `enumline` `status` on(((`status`.`Id` = `app`.`StatusId`) and (`status`.`ClientId` = 0) and (`patient`.`ClientId` = `app`.`ClientId`)))) left join `doctor` `doc` on(((`doc`.`Id` = `app`.`DoctorId`) and (`doc`.`ClientId` = `app`.`ClientId`)))) left join `enumline` `gender` on((`gender`.`Id` = `app`.`GenderId`))) order by `app`.`TokenNo`;

