DROP VIEW IF EXISTS `vw_client`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `vw_client` AS select `clients`.`Id` AS `Id`,`clients`.`UserId` AS `UserId`,`user`.`UserName` AS `User`,`user`.`Email` AS `Email`,`clients`.`ModuleIds` AS `ModuleIds`,group_concat(`module`.`Name` separator ',') AS `Modules`,`country`.`Id` AS `CountryId`,`city`.`Id` AS `CityId`,`city`.`Name` AS `City`,`clients`.`CategoryId` AS `CategoryId`,`category`.`Name` AS `Category`,`clients`.`ClientName` AS `ClientName`,`clients`.`Address` AS `Address`,`clients`.`Contact` AS `Contact`,`clients`.`Owner` AS `Owner`,`clients`.`RelevantPerson` AS `RelevantPerson`,`clients`.`CreatedOn` AS `CreatedOn`,`clients`.`CreatedById` AS `CreatedById`,`clients`.`ModifiedById` AS `ModifiedById`,`clients`.`ModifiedOn` AS `ModifiedOn`,`clients`.`IsActive` AS `IsActive` from (((((`clients` left join `aspnetusers` `user` on((`user`.`Id` = `clients`.`UserId`))) left join `enumline` `module` on(((0 <> find_in_set(`module`.`Id`,`clients`.`ModuleIds`)) and (`module`.`ClientId` = 0)))) left join `enumline` `city` on(((`city`.`Id` = `clients`.`CityId`) and (`city`.`ClientId` = 0)))) left join `enumline` `country` on(((`country`.`Id` = `clients`.`CountryId`) and (`country`.`ClientId` = 0)))) left join `enumline` `category` on(((`category`.`Id` = `clients`.`CategoryId`) and (`category`.`ClientId` = 0)))) group by `clients`.`Id`,`clients`.`ModuleIds`,`city`.`Name`,`category`.`Name`;

