-- ----------------------------
-- View structure for vw_item
-- ----------------------------
DROP VIEW IF EXISTS `vw_item`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `vw_item` AS select `item`.`Id` AS `Id`,`item`.`ClientId` AS `ClientId`,`item`.`ModuleId` AS `ModuleId`,`item`.`TypeId` AS `TypeId`,`type`.`Name` AS `ItemType`,`item`.`VendorId` AS `VendorId`,`item`.`Name` AS `Name`,`item`.`PurRate` AS `PurRate`,`item`.`SaleRate` AS `SaleRate`,`item`.`Conversion` AS `Conversion`,`item`.`GstSaleRate` AS `GstSaleRate`,`item`.`GstPurRate` AS `GstPurRate`,`item`.`SaleStRate` AS `SaleStRate`,`item`.`PurStRate` AS `PurStRate`,`item`.`PurUnits` AS `PurUnits`,`item`.`SaleUnits` AS `SaleUnits`,group_concat(distinct `sale`.`DisplayUOM` separator ',') AS `SalePossibleUnits`,group_concat(distinct `purchase`.`DisplayUOM` separator ',') AS `PurPossibleUnits`,`item`.`ExtraRate` AS `ExtraRate`,`item`.`RetailRate` AS `RetailRate`,`item`.`PrMazdoori` AS `PrMazdoori`,`item`.`UnitPrice` AS `UnitPrice`,`item`.`UnitsInStock` AS `UnitsInStock`,`item`.`ManufacturersId` AS `ManufacturersId`,`item`.`Formula` AS `Formula`,`item`.`CategoryId` AS `CategoryId`,`manfac`.`Name` AS `Manufacturer`,`cat`.`Name` AS `Category`,`item`.`Remarks` AS `Remarks`,`item`.`CreatedOn` AS `CreatedOn`,`item`.`CreatedById` AS `CreatedById`,`item`.`ModifiedOn` AS `ModifiedOn`,`item`.`ModifiedById` AS `ModifiedById`,`item`.`IsActive` AS `IsActive` from (((((`item` left join `uomconversion` `sale` on((0 <> find_in_set(`sale`.`Id`,`item`.`SaleUnits`)))) left join `enumline` `type` on(((`type`.`Id` = `item`.`TypeId`) and (`type`.`ClientId` = `item`.`ClientId`)))) left join `enumline` `cat` on(((`cat`.`Id` = `item`.`CategoryId`) and (`cat`.`ClientId` = `item`.`ClientId`)))) left join `enumline` `manfac` on(((`manfac`.`Id` = `item`.`ManufacturersId`) and (`manfac`.`ClientId` = `item`.`ClientId`)))) left join `uomconversion` `purchase` on((0 <> find_in_set(`purchase`.`Id`,`item`.`PurUnits`)))) group by `item`.`Id`,`item`.`ClientId`,`item`.`SaleUnits`,`item`.`PurUnits`,`manfac`.`Name`,`cat`.`Name`;

