DROP PROCEDURE IF EXISTS `GetNextAppt`;
delimiter ;;
CREATE PROCEDURE `GetNextAppt`(in whereClause varchar(5000),
in clientId int,
in doctorId int)
BEGIN
    DECLARE next_id INT;
    SET @sql =  whereClause;
    PREPARE stmt FROM @sql;
    EXECUTE stmt;
    DEALLOCATE PREPARE stmt;
        SELECT * FROM vw_appointment WHERE TokenNo = @next_id and vw_appointment.ClientId=clientId and vw_appointment.DoctorId=doctorId;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for GetNextVchNo
-- ----------------------------
DROP PROCEDURE IF EXISTS `GetNextVchNo`;
delimiter ;;
CREATE PROCEDURE `GetNextVchNo`(IN `VchKeyCode` varchar(200),
in clientId int,
 OUT `MaxVchNo` varchar(200))
BEGIN
    SELECT COALESCE(
        (SELECT VchNo
         FROM vw_voucher
         WHERE VchTypeKeyCode = VchKeyCode AND ClientId=clientId
         ORDER BY CAST(SUBSTRING_INDEX(VchNo, VchKeyCode, -1) AS SIGNED) DESC
         LIMIT 1), CONCAT(VchKeyCode, '0'))
    INTO MaxVchNo;
    
    SELECT MaxVchNo;
END
;;
delimiter ;

