delimiter ;;
CREATE PROCEDURE `ItemVariantUsedCount`(in id int)
BEGIN
select sum(tbl.EachTableCount) as Count
from
    (
    select count(0) as EachTableCount from saleline where ItemVariantId=id
UNION 
    select count(0) as EachTableCount from purchaseline where ItemVariantId=id
    )tbl;   
END
;;
