-- ----------------------------
-- Procedure structure for ManageAppointment
-- ----------------------------
DROP PROCEDURE IF EXISTS `ManageAppointment`;
delimiter ;;
CREATE PROCEDURE `ManageAppointment`(in id int,
    in tokenNo BIGINT,
    in clientId int,
    in patientid int,
    in doctorId int,
    in statusId int,
	in date date,
    in time text,
    in age text,
    in genderId int,
	in createdOn datetime,
	in createdById int,
	in modifiedOn datetime,
	in modifiedById int,
	in isActive bool,
	in DbOperation varchar(200))
BEGIN

if DbOperation='Insert'
then 
	 insert into appointment (Id,ClientId, PatientId,DoctorId,StatusId,TokenNo, Date, Time, Age, GenderId, CreatedOn, CreatedById, ModifiedOn,ModifiedById,IsActive ) 
	 values(id,clientId, patientid,doctorId,statusId,tokenNo, date, time, age, genderId,  createdOn,createdById,modifiedOn,modifiedById,isActive );
end If;

if DbOperation='Update'
then 
update appointment set 
	PatientId=patientid,
    DoctorId=doctorId,
    StatusId=statusId,
    TokenNo=tokenNo,
	 Date=date,
	 Time=time,
     Age=age,
     GenderId=genderId,
	 CreatedOn=createdOn,
	 CreatedById=createdById,
	 ModifiedOn=modifiedOn,
	 ModifiedById=modifiedById,
	 IsActive=isActive
 where appointment.Id= id and appointment.ClientId= clientId;
end If;

if DbOperation='Delete'
then
	DELETE FROM appointment where appointment.Id=id and appointment.ClientId= clientId;
end if;


if DbOperation='Activate'
then 
	update appointment set IsActive=1 where appointment.Id=id and appointment.ClientId= clientId;
end iF;


if DbOperation='DeActivate'
then 
	update appointment set IsActive=0 where appointment.Id=id and appointment.ClientId= clientId;
end iF;

END
;;
delimiter ;

