        in taskId int,
        in name varchar(700),
        in docPath varchar(7000),
        in size varchar(900),
        in base64File LONGTEXT,
        in createdOn datetime,
         in createdById int,
        in modifiedOn datetime,
        in modifiedById int,
        in isActive bit,
        in DBoperation varchar(50))
BEGIN
if DBoperation = 'Insert'
then
    
           insert into attachments (Id,TaskId,Name, DocPath,  Size, Base64File,CreatedOn,CreatedById, ModifiedOn, ModifiedById,  IsActive )  
           values 
           (id,taskId,name, docPath,  size, base64File,createdOn,createdById, modifiedOn, modifiedById, isActive);
 end if;   
/*update*/
 if DBoperation ='Update'
 then
            update attachments set 
                          TaskId=taskId,
                          Name=name,
                          DocPath=docPath,
                          Size=size,
                          Base64File=base64File,
                          CreatedOn=createdOn,
                          CreatedById=createdById,
                          ModifiedOn=modifiedOn,
                          ModifiedById=modifiedById,
						  IsActive=isActive						 
             where attachments.Id =id;
end if;
IF DBoperation = 'Delete'
then
       delete from attachments
			 where
			 attachments.Id=id ; 
end if;
IF DBoperation = 'Activate'
then
       update   attachments set IsActive=1
			 where 
			 attachments.Id=id ;
end if;
IF DBoperation = 'DeActivate'
then
       update  attachments set IsActive=0
			 where
			 attachments.Id=id; 
end if;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for ManageAttendance
-- ----------------------------
DROP PROCEDURE IF EXISTS `ManageAttendance`;
delimiter ;;
CREATE PROCEDURE `ManageAttendance`(In prm_Filter varchar (50),
  In prm_Id int ,
  In prm_SchDayId int ,
  In prm_UserId   Varchar(255),
  In prm_DayStartTime  datetime ,
  In prm_DayEndTime datetime ,
  In prm_Date datetime ,
  IN prm_CreatedBy INT,
  IN prm_CreatedOn datetime ( 0 ),
  IN prm_ModifiedBy INT,
  IN prm_ModifiedOn datetime ( 0 ),
  In prm_IsActive bit ( 1 ))
BEGIN

	

	-- SET prm_RetVal =- 1;

	IF

		( prm_Filter = 'Insert' ) THEN

		BEGIN
 
			insert into Attendance (Id, UserId, SchDayId ,DayStartTime ,DayEndTime ,
            Date, CreatedBy, CreatedOn, IsActive) 
			values (prm_Id, prm_UserId,prm_SchDayId  ,prm_DayStartTime ,prm_DayEndTime ,
            prm_Date,  prm_CreatedBy, prm_CreatedOn, prm_IsActive );

			-- SET prm_RetVal = LAST_INSERT_ID();

		END;

		ELSE

		IF

			( prm_Filter = 'Update' ) THEN

			BEGIN

				Update Attendance
				Set 
              UserId= prm_UserId,
			  SchDayId= prm_SchDayId  ,
			  DayStartTime=prm_DayStartTime ,
			  DayEndTime=prm_DayEndTime ,
			  Date= prm_Date,
              ModifiedBy = prm_ModifiedBy,
				ModifiedOn = prm_ModifiedOn,
				IsActive = prm_IsActive
				Where Id = prm_Id;

				-- SET prm_RetVal = prm_Id;

			END;

			ELSE

			IF

				( prm_Filter = 'Delete' ) THEN

				BEGIN

					DELETE FROM `Attendance` 
					WHERE Id = prm_Id;

					-- SET prm_RetVal = prm_Id;

				END;

				ELSE

				IF

					( prm_Filter = 'Disable' ) THEN

					BEGIN

							UPDATE `Attendance` 

							SET IsActive = 0,

							ModifiedBy = prm_ModifiedBy,

							ModifiedOn = prm_ModifiedOn 

						WHERE

							Id = prm_Id;

					-- 	SET prm_RetVal = prm_Id;

					END;

				END IF;

			END IF;

		END IF;

	END IF;

END
;;
delimiter ;

