DROP PROCEDURE IF EXISTS `ManageItem`;
delimiter ;;
CREATE PROCEDURE `ManageItem`(in id int,
		in clientId int,
        in moduleId int,
        in typeId int,
        in vendorId int,
        in name varchar(100),
        in purRate double,
        in saleRate double,
        in conversion double,
        in gstSaleRate double,
        in gstPurRate double,
        in saleStRate double,
        in purStRate double,
        in saleUnit text,
        in purUnit text,
        in extraRate double,
        in retailRate double,
        in prMazdoori double,
		in unitPrice double,
        in unitsInStock double,  
        in manufacturerId int,
        in formula text,
        in categoryId int,
        in remarks text,
        in createdOn datetime,
        in createdById int,
        in modifiedOn datetime,
        in modifiedById int,
        in isActive bit,
        in DBoperation varchar(50))
BEGIN
if DBoperation = 'Insert'
then
           insert into microerp.item
           (Id,ClientId, ModuleId,TypeId,VendorId,Name,PurRate,SaleRate,Conversion, GstSaleRate,GstPurRate,
           PurUnits,SaleUnits,SaleStRate,PurStRate,RetailRate,ExtraRate,PrMazdoori,UnitPrice,UnitsInStock,
           ManufacturersId,Formula,CategoryId,Remarks,
           CreatedOn, CreatedById,ModifiedOn, ModifiedById, IsActive ) 
           values (id,clientId, moduleId,typeId,vendorId,name,purRate,saleRate,conversion,gstSaleRate,gstPurRate,
           purUnit,saleUnit,saleStRate,purStRate,retailRate,extraRate,prMazdoori,unitPrice,unitsInStock,
           manufacturerId,formula,categoryId,remarks,
           createdOn, createdById, modifiedOn,modifiedById, isActive );
 end if;   
/*update*/
 if DBoperation ='Update'
 then
            update microerp.item set 
						  ModuleId=moduleId,
                          TypeId=typeId,
                          VendorId=vendorId,
                          Name=name,
                          PurRate=purRate,
                          SaleRate=saleRate,
                          Conversion=conversion,
                          GstSaleRate=gstSaleRate,
                          GstPurRate=gstPurRate,
                          SaleStRate=saleStRate,
                          PurStRate=purStRate,
                          SaleUnits=saleUnit,
                          PurUnits=purUnit,
                          RetailRate=retailRate,
                          ExtraRate=extraRate,
                          PrMazdoori=prMazdoori,
                          UnitPrice=unitPrice,
                          UnitsInStock=unitsInStock,
                          ManufacturersId=manufacturerId,
                          Formula=formula,
                          CategoryId=categoryId,
                          Remarks=remarks,
                          CreatedOn=createdOn,
                          CreatedById=createdById,
                          ModifiedOn=modifiedOn,
                          ModifiedById=modifiedById,
						  IsActive=isActive						 
             where microerp.item.Id =id and item.ClientId=clientId;
             if isActive=false
             then update itemvariants set   IsActive=0  where 
             itemvariants.ItemId=id and itemvariants.ClientId=clientId;
             end if;
              if isActive=true
              then update itemvariants set   IsActive=1  where 
             itemvariants.ItemId=id and itemvariants.ClientId=clientId;
             end if;
   end if;
   IF DBoperation = 'Delete'
    then
            delete from microerp.item
			where
			microerp.item.Id=id and  item.ClientId=clientId;
        END if;
IF DBoperation = 'Activate'
        then
            update microerp.item set IsActive=1
			where 
			microerp.item.Id=id and  item.ClientId=clientId;
        END if;
IF DBoperation = 'DeActivate'
        then
            update microerp.item set IsActive=0
			where
			microerp.item.Id=id and  item.ClientId=clientId;
        END if;
END
;;
delimiter ;

