delimiter ;;
CREATE PROCEDURE `ManageSale`(in id int,
        in supplierId int,
        in salesmanId int,
        in custId int,
        in acId int,
        in statusId int,
        in isPosted bit,
        in invNo varchar(45),
        in date datetime,
		in gross double,
        in discount double,
        in gst double,
        in credit double,
        in debit double,
        in packChrgs double,
        in freightChrgs double,
        in netPayable double,
        in description longtext,
        in createdOn datetime,
        in createdById int,
        in modifiedOn datetime,
        in modifiedById int,
        in isActive bit,
        in clientId int,
        in dboperation varchar(50))
BEGIN
if DBoperation = 'Insert'
then
           insert into sale (Id,SupplierId,SalesmanId,CustId, AcId,StatusId,IsPosted,
           InvNo,Date,Gross,Discount,Gst,Credit, Debit,PackChrgs,FreightChrgs,NetPayable,Description,
           CreatedOn, CreatedById,ModifiedOn, ModifiedById, IsActive, ClientId ) 
           values (id,supplierId,salesmanId,custId, acId,statusId,isPosted,invNo,date,gross,discount,gst,
           credit, debit,packChrgs,freightChrgs,netPayable,description,createdOn, createdById, modifiedOn,
           modifiedById, isActive, clientId);
 end if;   
/*update*/
if DBoperation ='Update'
 then
            update sale set
                          SupplierId=supplierId,
                          SalesmanId=salesmanId,
                          CustId=custId,
                          AcId=acId,
                          StatusId=statusId,
                          IsPosted=isPosted,
                          InvNo=invNo,
						  Date=date,
                          Gross=gross,
                          Discount=discount,
                          Gst= gst,
                          Credit= credit,
                          Debit=debit,
                          PackChrgs=packChrgs,
                          FreightChrgs=freightChrgs,
                          NetPayable=netPayable,
                          Description=description,
                          CreatedOn=createdOn,
                          CreatedById=createdById,
                          ModifiedOn=modifiedOn,
                          ModifiedById=modifiedById,
						  IsActive=isActive						 
             where sale.Id =id;
   end if;
IF DBoperation = 'Delete'
    then
             delete from saleline where  saleline.SaleId=id;
             delete from sale
			 where
			 sale.Id=id ; 
        END if;
IF DBoperation = 'Activate'
        then
             update saleline set IsActive=1 where  saleline.SaleId=id;
            update sale set IsActive=1
			where 
			sale.Id=id ;
        END if;
IF DBoperation = 'DeActivate'
        then
             update saleline set IsActive=0 where  saleline.SaleId=id;
            update sale set IsActive=0
			where
			sale.Id=id;            
        END if;
END
;;
delimiter ;

