-- ----------------------------
-- Procedure structure for Manage_scheduleday
-- ----------------------------
DROP PROCEDURE IF EXISTS `Manage_scheduleday`;
delimiter ;;
CREATE PROCEDURE `Manage_scheduleday`(In prm_Filter varchar (50),
	In prm_Id  int, 
    In prm_DayId  int, 
    In prm_SchId  int, 
	IN prm_CreatedBy INT,
	IN prm_CreatedOn datetime ( 0 ),
	IN prm_ModifiedBy INT,
	IN prm_ModifiedOn datetime ( 0 ),
	In prm_IsActive bit ( 1 ))
BEGIN

	

	-- SET prm_RetVal =- 1;

	IF

		( prm_Filter = 'Insert' ) THEN

		BEGIN

			insert into scheduleday (Id, DayId,SchId, CreatedBy, CreatedOn, IsActive)
			values (prm_Id, prm_DayId,prm_SchId, prm_CreatedBy, prm_CreatedOn, prm_IsActive );

			-- SET prm_RetVal = LAST_INSERT_ID();

		END;

		ELSE

		IF

			( prm_Filter = 'Update' ) THEN

			BEGIN

				Update scheduleday
				Set                      
				ModifiedBy = prm_ModifiedBy,
				ModifiedOn = prm_ModifiedOn,
				IsActive = prm_IsActive
				Where  scheduleday.SchId=prm_SchId and scheduleday.DayId =prm_dayId;

				-- SET prm_RetVal = prm_Id;

			END;

			ELSE

				IF

				( prm_Filter = 'Delete' ) THEN

				BEGIN

					DELETE FROM `scheduleday` 
					Where  scheduleday.SchId=prm_SchId and scheduleday.DayId =prm_dayId;

					-- SET prm_RetVal = prm_Id;

				END;
				ELSE

				IF

					( prm_Filter = 'Disable' ) THEN

					BEGIN

							UPDATE `scheduleday` 

							SET IsActive = 0,

							ModifiedBy = prm_ModifiedBy,

							ModifiedOn = prm_ModifiedOn 

							Where  scheduleday.SchId=prm_SchId and scheduleday.DayId =prm_dayId;

					-- 	SET prm_RetVal = prm_Id;

					END;

				END IF;

			END IF;

		END IF;

	END IF;

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for Manage_VoucherType
-- ----------------------------
DROP PROCEDURE IF EXISTS `Manage_VoucherType`;
delimiter ;;
CREATE PROCEDURE `Manage_VoucherType`(in id int,
        in clientId int,
        in name varchar(100),
        in defaultDrCrFirst bit(1),
        in keyCode varchar(100),
        in defaultDrCrSecondId int,
        in createdOn datetime,
        in createdById int,
        in modifiedOn datetime,
        in modifiedById int,
        in isActive bit,
        in DBoperation varchar(50))
BEGIN
if DBoperation = 'Insert'
then
    
           insert into vouchertype (Id,ClientId,Name,DefaultDrCrFirst
           ,KeyCode,DefaultDrCrSecondId,
           CreatedOn, CreatedById,
           ModifiedOn, ModifiedById, IsActive ) 
           values (id,clientId,name,defaultDrCrFirst ,keyCode,
           defaultDrCrSecondId,
           createdOn, createdById, modifiedOn,
           modifiedById, isActive );
 end if;   
/*update*/
 if DBoperation ='Update'
 then
            update vouchertype set 
                          Name=name,
                          DefaultDrCrFirst =defaultDrCrFirst ,
                          KeyCode=keyCode,
                          DefaultDrCrSecondId=defaultDrCrSecondId,
                          CreatedOn=createdOn,
                          CreatedById=createdById,
                          ModifiedOn=modifiedOn,
                          ModifiedById=modifiedById,
						  IsActive=isActive						 
             where vouchertype.Id =id and vouchertype.ClientId=clientId;
   end if;
   IF DBoperation = 'Delete'
    then
            delete from vouchertype
			where
			vouchertype.Id=id and vouchertype.ClientId=clientId; 
        END if;
IF DBoperation = 'Activate'
        then
             update vouchertype set IsActive=1
			where 
			vouchertype.Id=id and vouchertype.ClientId=clientId;
        END if;
IF DBoperation = 'DeActivate'
        then
            update vouchertype set IsActive=0
			where
			vouchertype.Id=id and vouchertype.ClientId=clientId;
           
        END if;

END
;;
delimiter ;

